import React, { Component } from "react";
import "./sidebar.css";

class Sidebar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="sidebar">
        <div
          onClick={() => this.props.handleNavigation(1)}
          className="sidebar-detail"
        >
          Bank
        </div>
        <div
          onClick={() => this.props.handleNavigation(2)}
          className="sidebar-detail"
        >
          Recharge
        </div>
        <div
          onClick={() => this.props.handleNavigation(3)}
          className="sidebar-detail"
        >
          View Packs
        </div>
        <div
          onClick={() => this.props.handleNavigation(4)}
          className="sidebar-detail"
        >
          Subscribe
        </div>
        <div
          onClick={() => this.props.handleNavigation(5)}
          className="sidebar-detail"
        >
          Add Channels
        </div>
        <div
          onClick={() => this.props.handleNavigation(6)}
          className="sidebar-detail"
        >
          Special Services
        </div>
        <div
          onClick={() => this.props.handleNavigation(7)}
          className="sidebar-detail"
        >
          Current Subscription
        </div>
        <div
          onClick={() => this.props.handleNavigation(8)}
          className="sidebar-detail"
        >
          Update Contact Details
        </div>
      </div>
    );
  }
}
export default Sidebar;
